import React from 'react';

class Table extends React.Component() {
    constructor(props) {
        super(props);
        this.state = {
            eventError: null,
            isLoadedEvents: false,
            eventItems: [],
            venueError: null,
            isLoadedVenue: false,
            venueItems: [],
            artistError: null,
            isLoadedArtist: false,
            artistItems: [],
        };
    }

    componentDidMount() {


        fetch("https://oll-coding-exercise.s3-us-west-2.amazonaws.com/venues.json")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoadedVenue: true,
                        venueItem: result.items
                    })
                }
            )

        fetch("https://oll-coding-exercise.s3-us-west-2.amazonaws.com/artists.json")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoadedArtists: true,
                        artistItems: result.items
                    })
                }
            )


    }

    render() {
        return (
            <div>Hello </div>
        );
    }


}


export default Table;
